import React,{ Component } from 'react'
import { View, Text, Button, StyleSheet, ImageBackground,Image, ScrollView} from 'react-native';
import AppIntroSlider from 'react-native-app-intro-slider';

export default class Skinks extends Component{
    render() {

        return (
          <View style={styles.container}>
            <ImageBackground
            source={require('./assets/skins.jpeg')}
            style={styles.imagemFundo}>

            <View style={[styles.caixa, styles.elevation]}/>
            <Text style={ styles.text }>F R I E N D S </Text>
            &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 
            </ImageBackground>
            
          </View>

        );
    
}

}
const styles = StyleSheet.create({
    titulo: {
      fontSize: 70,
      marginBottom: 40,
      marginTop: 1,
      color: 'white',
  
    },
    container: {
      flex: 1,
      backgroundColor: 'black',
      justifyContent: "center",
      alignItems: 'center',
      textAlign: 'center',
    },
    imagemFundo:{
        height:'100%',
        width:'100%',
        opacity:'10%',
    },
    caixa: {
      backgroundColor: 'grey',
      justifyContent: 'center',
      height: 600,
      width: 600,
      borderRadius: 20,
      alignSelf:'center',
      opacity:'80%',
      resizeMode: "center",
      marginBottom: 10,
    },
    elevation: {
      height: 600,
      width: 600,
      shadowColor: '#0c0c0c',
      alignSelf:'center',
      justifyContent:'center',
      alignItems:'center',
      resizeMode: "center",
      marginBottom: 100,
      margin:70,
  
    },
    text:{
      color: 'white',
    }
  });
